const btnHambuger=document.querySelector("#nav-mobile-btn");btnHambuger.addEventListener("click",(function(){document.querySelector("body").classList.add("-is-menu-open")}));const closeMenuBtnHam=document.querySelector(".menu-nav-mobile__btn-close");closeMenuBtnHam.addEventListener("click",(function(){document.querySelector("body").classList.remove("-is-menu-open")}));const btnDropDown=document.querySelectorAll(".dropdown");for(c of btnDropDown)c.addEventListener("click",(function(){this.classList.contains("-is-active")?(this.classList.remove("-is-active"),this.parentNode.querySelector(".dropdown-content").classList.remove("-is-active")):(this.classList.add("-is-active"),this.parentNode.querySelector(".dropdown-content").classList.add("-is-active"))}));let menuLinks=document.querySelectorAll(".menu-item");menuLinks&&menuLinks.forEach(e=>{e.querySelector("a").addEventListener("click",(function(e){e.preventDefault();var t=this.getAttribute("href");t.indexOf("#")>-1?document.querySelector(t).scrollIntoView({behavior:"smooth",block:"start"}):window.location.href=t}))}),document.querySelector("#to-up").addEventListener("click",(function(e){e.preventDefault(),document.querySelector("body").scrollIntoView({behavior:"smooth",block:"start"})}));